import React from 'react';
import Article from '../../components/magazine/Magazine';
import { Space, Space1, Space2, Space3, Space4 } from './imports';
import './blog.css';

const Blog = () => (
  <div className="magazine__blog section__padding" id="blog">
    <div className="magazine__blog-heading">
      <h1 className="gradient__text">A lot is happening, <br /> We are blogging about it.</h1>
    </div>
    <div className="magazine__blog-container">
      <div className="magazine__blog-container_groupA">
        <Article imgUrl={Space} date="Sep 26, 2021" text="" />
      </div>
      <div className="magazine__blog-container_groupB">
        <Article imgUrl={Space1} date=" November 12, 2023" text="Quantum Computer Chronicles: Unlocking the Enigmatic World of Quantum Computing." />
        <Article imgUrl={Space2} date="August 7, 2022" text="BRUSH & VERSE: A night of art and god's word." />
        <Article imgUrl={Space3} date="April 15, 2025" text="Whispers of the Cosmos: Cosmic Horoscopes Revealed." />
        <Article imgUrl={Space4} date="October 3, 2026" text="Chronicles of the Cryptids: Tales from the Hidden Realms." />
      </div>
    </div>
  </div>
);

export default Blog;
